import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

function Signup() {
  const navigate = useNavigate();
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = async (event) => {
    event.preventDefault();

    try {
      const response = await fetch('http://localhost:4000/api/auth/login', {
        method: "POST", // *GET, POST, PUT, DELETE, etc.
        mode: "cors", // no-cors, *cors, same-origin
        cache: "no-cache", // *default, no-cache, reload, force-cache, only-if-cached
        credentials: "same-origin", // include, *same-origin, omit
        headers: {
          "Content-Type": "application/json",
        },
        redirect: "follow", // manual, *follow, error
        referrerPolicy: "no-referrer", // no-referrer, *no-referrer-when-downgrade, origin, origin-when-cross-origin, same-origin, strict-origin, strict-origin-when-cross-origin, unsafe-url
        body: JSON.stringify({username: username, password: password}),
      });

      if (response.status=== 200)
      // If login is successful, navigate to the homepage
      navigate('/homepage');
      else 
      {
       console.log(response) 
      }
    } catch (error) {
      console.log(error);
    }
  };

  return (
    <div className="flex flex-col items-center lg:items-end w-full">
    <div className="form bg-white w-full lg:w-1/2 drop-shadow-2xl px-12 py-6 rounded-xl flex flex-col border border-black/60">
      <div class="text-2xl font-bold"> Login</div>
      <hr className='mb-4 mt-4'/>
      <form onSubmit={handleSubmit}>
        <div className="form-group flex flex-col space-y-2">
          <label htmlFor='username' className='text-xl text-gray-800'>Username</label>
          <input className='p-3 border border-black/20 rounded-xl' type="text" name="username" placeholder="username" value={username} onChange={(event) => setUsername(event.target.value)} />
        </div>

        <div className="form-group flex flex-col space-y-2 mt-4">
          <label htmlFor='password' className='text-xl text-gray-800'>Password</label>
          <input className='p-3 border border-black/20 rounded-xl' type="password" name="password" placeholder="password" value={password} onChange={(event) => setPassword(event.target.value)} />
        </div>

        <div className="footer">
          <button className='w-full bg-black py-3 mt-4 rounded-xl text-white' type="submit">Login</button>
          <div className='flex flex-row items-center justify-start mt-4'>
            <label>Not a member?</label>
          </div>

          <div className="footer">
            <button className='w-full border border-black py-3 mt-4 rounded-xl text-black/60 hover:bg-black hover:text-white transition-all ease-linear' onClick={() => { navigate('/register') }}>Register</button>
          </div>

          <button class="mt-8 underline underline-offset-4 w-full text-xl hover:-translate-y-2 transition-all ease-linear" onClick={() => { navigate('/productform') }}>test</button>
        </div>
      </form>
    </div>
  </div>
  );
}

export default Signup;
